package com.mmall.vo;import java.math.BigDecimal;import java.util.List;/** * @author chenqiang * @create 2020-07-03 13:39 */public class CartVo {    private List<CartProductVo> cartProductVoList;    private Boolean allChecked;    private BigDecimal cartTotalPrice;    private String imageHost;    public List<CartProductVo> getCartProductVoList() {        return cartProductVoList;    }    public void setCartProductVoList(List<CartProductVo> cartProductVoList) {        this.cartProductVoList = cartProductVoList;    }    public Boolean getAllChecked() {        return allChecked;    }    public void setAllChecked(Boolean allChecked) {        this.allChecked = allChecked;    }    public BigDecimal getCartTotalPrice() {        return cartTotalPrice;    }    public void setCartTotalPrice(BigDecimal cartTotalPrice) {        this.cartTotalPrice = cartTotalPrice;    }    public String getImageHost() {        return imageHost;    }    public void setImageHost(String imageHost) {        this.imageHost = imageHost;    }}